import React, {useState} from 'react';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import './css/About.css';
import Typography from '@material-ui/core/Typography';
import {withStyles, createStyles} from '@material-ui/styles';
import Navigation from './navigation';
import Contact from './contact';
import StyledProps from './StyledProps';
import nateshim from './static/nateshim.png';
import {WindupChildren, Pace} from 'windups';
import AOS from 'aos';
import 'aos/dist/aos.css';

const About = (props: StyledProps) => {
  const classes = props.classes;
  AOS.init();
  return (   
    <Box className={classes.backgroundContainer}>
      <Container className={classes.section} maxWidth={false}>
        <WindupChildren>
          <span className={classes.bigText}>
            <Pace ms={100}>{"          Hello."}</Pace>
          </span>
        </WindupChildren>
      </Container>
      <Container className={classes.bio} maxWidth={false}>
        <Box display={{xs: 'block', sm: 'flex', md: 'flex', lg: 'flex'}}>
          <img data-aos="fade-right" data-aos-delay='300' data-aos-duration='1000' src={nateshim} className={classes.avatar}/>
          <Container data-aos="fade-left" data-aos-delay='300' data-aos-duration='1000'>
            <Typography className={classes.text}>I am a web developer based in the Bay Area. I enjoy creating simple and beautiful apps that are easy to use.</Typography>
          </Container>
        </Box>
      </Container>

      <Contact/>
    </Box> 
  );
}

const useStyles = createStyles({
  section: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#F7F3F2',
    justifyContent: 'center',
    padding: '10rem 0',

  },
  bio: {
    display: 'flex',
    flexDirection: 'column',
    backgroundColor: '#8F8073',
    justifyContent: 'center',
    padding: '10rem 0',
  },
  aboutMe: {
    display: 'flex',
    flexDirection: 'row',
    backgroundColor: '#FEB954',
    justifyContent: 'center',
    padding: '4rem 0',
  },
  aboutMeBox: {
    padding: '10rem',
  },
  text: {
    fontFamily: 'Colombo',
    color: '#12130F',
    fontSize: '3rem',
    textAlign: 'center',
    padding: '2rem',
  },
  bigText: {
    fontFamily: 'Colombo',
    color: '#12130F',
    fontSize: '4rem',
    textAlign: 'center',
    paddingBottom: '15rem',
    fontWeight: 'bold',
  },
  gif: {
    height: '200px',
    width: '200px',
  },
  bioTitle: {
    fontFamily: 'Colombo',
    color: '#12130F',
    fontSize: '3rem',
    padding: '1rem',
  },
  backgroundContainer: {
    backgroundSize: 'cover',
    height: '100%',
    width: '100%',
    backgroundColor: '#F7F3F2',
    backgroundPosition: 'center',
  },
  avatar: {
    height: '250',
    width: '300px',
  },
});

export default withStyles(useStyles)(About);
